Are you looking for a futuristic vape experience? Look no further than the Plena 18K Disposable Vape! Complete with a dual mesh coil to make each puff extra smooth and bold, its time to experience vaping in style with this sleek and long-lasting device. With up to 18,000 puffs packed into this USB-C rechargeable vape, you no longer have to sacrifice convenience for longevity with its large 850 mAh battery. Step into a world of fun tech features with an LED screen displaying cool animations and a battery and e-juice level indicator. With these features, you wont have to worry about running out mid-session when you're on the go. Upgrade your disposable e-cig today and vape smarter, not harder!

5% nicotine by weight (50mg/mL);
Made with salt nic e-juice;
Pre-charged and pre-filled;
Dual mesh coils;
Full-color LED screen;
